import { Balloon } from '../components'


export default function calculateRewards(garden, seeds) {
  const rewards = []
  console.log("Calculating Rewards")
  console.log("Garden")
  console.log(garden.length)
  console.log("Seeds")
  if (garden.length % 5 === 0) {
    rewards.push()
  }
  return rewards
}
